-- Table structure for `payorder`
-- ----------------------------
DROP TABLE IF EXISTS `payorder`;
CREATE TABLE `payorder` (
  `id` varchar(64) NOT NULL,
  `userid` varchar(64) NOT NULL,
  `gmt_create` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  `subject` varchar(64) DEFAULT NULL COMMENT '商品名称',
  `body` varchar(64) DEFAULT NULL COMMENT '商品描述',
  `price` float DEFAULT NULL COMMENT '价格',
  `outTradeno` varchar(64) DEFAULT NULL COMMENT '商户订单号',
  `banktype` varchar(64) DEFAULT NULL COMMENT '银行卡类型',
  `deviceinfo` varchar(64) DEFAULT NULL COMMENT '设备信息，',
  `spbillcreateip` varchar(64) DEFAULT NULL COMMENT '支付创建ip',
  `authcode` varchar(64) DEFAULT NULL COMMENT '付款条码串  与设备号类似？？？',
  `wapurl` varchar(64) DEFAULT NULL COMMENT 'WAP支付链接',
  `wapname` varchar(64) DEFAULT NULL COMMENT 'WAP支付网页名称',
  `openid` varchar(64) DEFAULT NULL COMMENT '微信会员唯一标识',
  `payid` varchar(64) DEFAULT NULL,
  `transactiontype` varchar(64) DEFAULT NULL,
  `userpay` tinyint(4) DEFAULT '0' COMMENT '用户已经再页面上显示支付成功',
  `alinoticepay` tinyint(4) DEFAULT '0' COMMENT '阿里回调已经支付',
  `trade_no` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of payorder
-- ----------------------------

