-- Table structure for `pay_account`
-- ----------------------------
DROP TABLE IF EXISTS `pay_account`;
CREATE TABLE `pay_account` (
  `payid` varchar(64) NOT NULL COMMENT '支付账号id',
  `partner` varchar(32) DEFAULT NULL COMMENT '支付合作id,商户id，差不多是支付平台的账号或id',
  `appid` varchar(32) DEFAULT NULL COMMENT '应用id',
  `publickey` varchar(2048) DEFAULT NULL COMMENT '支付平台公钥(签名校验使用)，sign_type只有单一key时public_key与private_key相等，比如sign_type=MD5(友店支付除外)的情况',
  `privatekey` varchar(2048) DEFAULT NULL COMMENT '应用私钥(生成签名)',
  `notifyurl` varchar(1024) DEFAULT NULL COMMENT '异步回调地址',
  `returnurl` varchar(1024) DEFAULT NULL COMMENT '同步回调地址',
  `seller` varchar(256) DEFAULT NULL COMMENT '收款账号, 针对支付宝',
  `signtype` varchar(16) DEFAULT NULL COMMENT '签名类型',
  `inputcharset` varchar(16) DEFAULT NULL COMMENT '枚举值，字符编码 utf-8,gbk等等',
  `paytype` char(16) DEFAULT NULL COMMENT '支付类型,aliPay：支付宝，wxPay：微信, youdianPay: 友店微信,此处开发者自定义对应com.egzosn.pay.demo.entity.PayType枚举值',
  `msgtype` char(8) DEFAULT NULL COMMENT '消息类型，text,xml,json',
  `test` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否为测试环境',
  `gmt_create` date DEFAULT NULL,
  `gmt_modified` date DEFAULT NULL,
  PRIMARY KEY (`payid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

