INSERT INTO `sys_gen_temp` VALUES ('eec20f89d1e94599945fca174f500a711517922888819', 'Service模板', 'packagePath/domain/classNameService.java', '2018-02-06 21:14:48', '2018-02-06 21:14:48', 'package ${package}.service;\n\nimport ${package}.domain.${className}DO;\nimport ${package}.domain.${className}VO;\nimport ${package}.qvo.${className}Query;\n\nimport java.util.List;\nimport java.util.Map;\nimport com.ybg.base.jdbc.BaseMap;\nimport com.ybg.base.util.Page;\n\n/**\n * ${comments}\n * \n * @author ${author}\n * @email ${email}\n * @date ${datetime}\n */\npublic interface ${className}Service {\n	\n	 /** 返回主键的创建\n	 * \n	 * @throws Exception **/\n	${className}VO save(${className}VO bean) throws Exception;\n	\n	/** 更新数据，条件 和 需要更新的字段都不能为空 不限个数个条件\n	 * \n	 * @author Deament\n	 * @param updatemap\n	 *            需要更新的字段和值\n	 * @param wheremap\n	 *            更新中的条件字段和值\n	 * @param table_name\n	 *            表的名称 **/\n	// sys_role\n	void update(BaseMap<String, Object> updatemap, BaseMap<String, Object> wheremap);\n	\n	/** 分页查询 **/\n	// sys_role\n	Page list(Page page,${className}Query qvo)throws Exception;\n	\n	/** 不分页查询 **/\n	// sys_role\n	List<${className}VO> list(${className}Query qvo)throws Exception;\n	/** 根据条件删除 **/\n	void remove(BaseMap<String, Object> wheremap);\n	\n	 ${className}VO get(${pk.attrType} id);\n}\n', '1');
